import { useState, useEffect } from 'react';


const Card = ({id, image, name, heigth, weigth, temperament, lifeSpan, onClose}) => {
    const dispatch = useDispatch()
    const dogs = useSelector(state => state.allDogs)
    console.log(dogs);

    useEffect(() => {
        dispatch(getByBreed())
    }, [])

    return (
        <div>
      {dogs.map((dog) => (
        <div key={dog.id}>
          <h2>{dog.name}</h2>
          <img src={dog.image.url} alt='' />
          {/* Renderizar más información si es necesario */}
        </div>
      ))}
    </div>
  );
};

export default Card
